// ConsultingPreview.js
import React from "react";
import { useLocation, useNavigate } from "react-router-dom";
import jsPDF from "jspdf";
import html2canvas from "html2canvas";

export default function ConsultingPreview() {
  const navigate = useNavigate();
  const location = useLocation();

  const {
    selectedData = [],
    company = "",
    doc_number = "",
    discountRate = 0,
    vat = 0,
    totalCost = 0,
    discountAmount = 0
  } = location.state || {};

  const downloadPDF = () => {
    const doc = new jsPDF("p", "pt", "a4");
    const input = document.getElementById("invoice-content");
    const filename = `${company}_Í≤¨Ï†ÅÏÑú.pdf`;

    html2canvas(input, { scale: 2 }).then(canvas => {
      const imgData = canvas.toDataURL("image/png");
      const pdfWidth = doc.internal.pageSize.getWidth() - 40;
      const imgProps = doc.getImageProperties(imgData);
      const pdfHeight = (imgProps.height * pdfWidth) / imgProps.width;
      doc.addImage(imgData, "PNG", 20, 20, pdfWidth, pdfHeight);
      doc.save(filename);
    });
  };

  return (
    <>
      <div id="invoice-content" style={{ maxWidth: 800, margin: "0 auto", padding: 40, backgroundColor: "#fff", border: "1px solid #ddd" }}>
        <h1>Í≤¨Ï†ÅÏÑú</h1>
        <p>Î¨∏ÏÑúÎ≤àÌò∏: {doc_number}</p>
        <p>ÏóÖÏ≤¥Î™Ö: {company}</p>

        <table style={{ width: "100%", borderCollapse: "collapse", marginTop: 30 }}>
          <thead>
            <tr style={{ background: "#eee" }}>
              <th>Ìï≠Î™©</th><th>ÏàòÎüâ</th><th>Îã®Í∞Ä</th><th>Í∏àÏï°</th><th>ÎπÑÍ≥†</th>
            </tr>
          </thead>
          <tbody>
            {selectedData.map((item, idx) => (
              <tr key={idx}>
                <td>{item.label}</td>
                <td style={{ textAlign: "center" }}>{item.qty}</td>
                <td style={{ textAlign: "center" }}>{Number(item.unit || 0).toLocaleString()}</td>
                <td style={{ textAlign: "right" }}>{Number(item.value || 0).toLocaleString()} Ïõê</td>
                <td>{item.note}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <div style={{ textAlign: "right", marginTop: 20 }}>
          {discountRate > 0 && (
            <p>Ìï†Ïù∏Ïú®: {discountRate}% (-{Number(discountAmount).toLocaleString()} Ïõê)</p>
          )}
          <p>Î∂ÄÍ∞ÄÏÑ∏(VAT): {Number(vat).toLocaleString()} Ïõê</p>
          <h3>Ï¥ù Ìï©Í≥Ñ: {Number(totalCost).toLocaleString()} Ïõê</h3>
        </div>
      </div>

      <div style={{ marginTop: 30, textAlign: "center" }}>
        <button onClick={() => navigate("/consulting")}>üîÅ Îã§ÏãúÌïòÍ∏∞</button>
        <button onClick={downloadPDF} style={{ marginLeft: 20 }}>üì• PDF Îã§Ïö¥Î°úÎìú</button>
      </div>
    </>
  );
}
